I was having a good day today, last day of work until Tuesday so 3 days off buzzing. Until my last break at work... I was going for my lunch, I eat a full breakfast and my lunch at work so two decent sized meals. I cater for myself only so that means I can just have something smaller for my dinner and I don't have to spend hours in the kitchen.

I got a comment from someone saying your putting weight on since you started working here... Wow did my head go! Luckily my mouth didn't activate and I could laugh it off and carry on.

I'm blessed with a head that holds onto negative comments more than positive ones. It makes me feel like I have to prove myself even though it was just a one off comment and I should let it go. 

I wasn't really up for the gym before Friday night 5km club but thanks to this guy beast mode was activated! I know full well that even if I did put a bit of weight on its not the end of the world but just little day to day triggers show I still need to be more self confident, rather than push myself some more.

Nobody said gaining self love is easy! We all days where I comment from someone can bring us down. Just keep believing in yourself and what you are doing ğŸ˜

